import requests
from bs4 import BeautifulSoup

def get_actor_info(actor_name):
    # Replace spaces with underscores to match Wikipedia URL format
    formatted_actor_name = actor_name.replace(' ', '_')
    
    # Send a request to the actor's Wikipedia page
    url = f"https://en.wikipedia.org/wiki/{formatted_actor_name}"
    # print(url)
    response = requests.get(url)
    
    # If the request is successful, proceed with scraping
    if response.status_code == 200:
        soup = BeautifulSoup(response.text, 'html.parser')
        
        # Find the infobox and the birth/death information
        infobox = soup.find('table', {'class': 'infobox'})
        if infobox:
            bdate_tag = infobox.find('span', {'class': 'bday'})
            ddate_tag = infobox.find('span', {'class': 'dday'})
            
            # Extract the birth and death dates (if available)
            birth_date = bdate_tag.text if bdate_tag else "FAIL"
            death_date = ddate_tag.text if ddate_tag else "N/A"
            
            return birth_date, death_date
        else:
            return "FAIL", "FAIL"
    else:
        return "FAIL", "FAIL"

